import React from 'react';
import PageWrapper from './componets/PageWrapper';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
    <PageWrapper>

        <Route
          exact={true}
          path="/"
          component={Home}
        />

        <Route
          path="/about"
          component={About}
        />



    </PageWrapper>
    </Router>
  );
}

export default App;
